import './App.css';

function Header(props) {
  return (
    <header>
	  <h1>Main Heading Is Here {props.name}</h1>
    </header>
  );
}

function Body(){
	return(
		<section>
			<h1>The Body will be Here</h1>
			<p>All The rest here too</p>
		</section>
	);
}

function Footer(props){
	return(
		<footer>
			<ul>
			 <li>Footer 1</li>
			<li>Footer 2</li>
			<li>Footer {props.year}</li>
			</ul>
		</footer>
	)
}

const dishes = [
	"Musa",
	"Tivo",
	"Kevin",
	"Steve"
];

dishes.map(dish);
console.log(dish);

function App() {
  return (
    <div className="App">
	  <Header name="Tivo"/>
	  <Body />
	  <Footer year={new Date().getFullYear()}/>
    </div>
  );
}

export default App;
